var yaa = require('../../../bin/index.js');
var test = require('../../test.js');
var cases = [];
var context = {};

module.exports = test(cases, __filename.substr(__dirname.length + 1), context);

var one = {};
var two = {};
var three = {};



var iterator = yaa.iterator.array([one, two, three]);

cases.push(yaa.assert.outputEquals(
    iterator, yaa.insert(one), 'Iterator correct.'));

cases.push(yaa.assert.outputEquals(
    iterator, yaa.insert(two), 'Iterator correct.'));

cases.push(yaa.assert.outputEquals(
    iterator, yaa.insert(three), 'Iterator correct.'));

cases.push(yaa.assert.outputEquals(
    iterator, yaa.nothing(), 'Iterator correct.'));

cases.push(yaa.assert.outputEquals(
    iterator, yaa.nothing(), 'Iterator correct.'));